Galapagos (BBC Born of Fire)

Nature Documentary hosted by Tilda Swinton, published by BBC in 2007 - English narration


Information
------------------------------

Natural history series exploring the Galapagos Islands, which lie 1,000 kilometres off the coast of South America.


1)  Born of Fire 
This programme examines the fascinating stages of the islands' lives and how a variety of creatures have found ways to survive, including marine iguanas, sea-going lizards and giant tortoises.

2)  Islands that Changed the World 
From flightless cormorants hunting underwater to giant tortoises courting on the rim of an active volcano, a look at the hidden side of Galapagos, revealing why it is such a fascinating showcase for evolution.

3)  Forces of Change 
Animals and plants in the Galapagos have evolved the most surprising ways to cope with the profound geological and climatic forces.

